const MyEventsPage = ({ navigation }) => {
  const [searchQuery, setSearchQuery] = useState('');
  const [showOnlyFree, setShowOnlyFree] = useState(false);
  const [activeSection, setActiveSection] = useState('ongoing'); // Track active section

  const getActiveEvents = () => {
    const events = myEventsData[activeSection];
    return showOnlyFree ? events.filter((event) => event.price === 'Free') : events;
  };

  const renderEventCard = ({ item }) => (
    <TouchableOpacity style={styles.card}>
      <Image source={{ uri: item.image }} style={styles.cardImage} />
      <View style={styles.topIcons}>
        <TouchableOpacity>
          <Ionicons name="heart-outline" size={20} color="#fff" />
        </TouchableOpacity>
        <TouchableOpacity>
          <Ionicons name="share-outline" size={20} color="#fff" />
        </TouchableOpacity>
      </View>
      <Text style={styles.cardDate}>{item.date}</Text>
      <Text style={styles.cardTitle}>{item.title}</Text>
      <View style={styles.footerRow}>
        <Text style={styles.priceText}>{item.price}</Text>
        <TouchableOpacity style={styles.ticketButton}>
          <Text style={styles.ticketButtonText}>View Details</Text>
        </TouchableOpacity>
      </View>
    </TouchableOpacity>
  );

  return (
    <View style={styles.container}>
      <StatusBar />
      {/* <HeaderWithFaceIcon title="My Events" /> */}
      <HeaderWithOnlyName title="Saved Events" />

      {/* Search Bar */}
      <View style={styles.searchContainer}>
        <Ionicons name="search" size={20} color="#666" style={styles.searchIcon} />
        <TextInput
          style={styles.searchInput}
          placeholder="Search for events"
          placeholderTextColor="#999"
          value={searchQuery}
          onChangeText={setSearchQuery}
        />
      </View>

      {/* Toggle Buttons */}
      <View style={styles.toggleContainer}>
        {['upcoming', 'ongoing', 'past'].map((section) => (
          <TouchableOpacity
            key={section}
            style={[
              styles.toggleButton,
              activeSection === section && styles.activeToggleButton,
            ]}
            onPress={() => setActiveSection(section)}
          >
            <Text
              style={[
                styles.toggleButtonText,
                activeSection === section && styles.activeToggleText,
              ]}
            >
              {section.charAt(0).toUpperCase() + section.slice(1)}
            </Text>
          </TouchableOpacity>
        ))}
      </View>


      {/* Event Cards */}
      <FlatList
        data={getActiveEvents()}
        renderItem={renderEventCard}
        keyExtractor={(item) => item.id}
        contentContainerStyle={styles.cardContainer}
        ListEmptyComponent={
          <Text style={styles.emptyMessage}>No events available</Text>
        }
      />
      <Footer
        currentScreen="MyEvents"
        onHomePress={() => navigation.navigate('Home')}
        onEventsPress={() => navigation.navigate('Deals')}
        onMapsPress={() => navigation.navigate('Maps')}
        onMyEventsPress={() => navigation.navigate('MyEvents')}
      />
      <Footerforbase />
    </View>
  );
};

